import {useState} from "react"

function App() {
  const [email, setEmail]= useState("") ; 
  const sendEmail= async(e)=>{
    e.preventDefault()


  }  // This Arrow function is called after the submit buton is pressed. 
  return (
    <div className="--center-all --flex-center --bg-primary --100vh">
      <div className="--width-500px --card --bg-light"> 
       <form  onSubmit={sendEmail} className="--form-control  ">
        <input type="email" value={email} 
         placeholder="Email"
         onChange = {(e)=>setEmail(e.target.value)}
        />
        <button type="submit" className='--btn --btn-primary --50px'>
          Send Email
        </button>
      </form>
      </div>
    </div>
  );
}

export default App;
